class Solution:
    def __init__(self, stdin: str):
        self.stdin = stdin
        self.M, self.S = map(int, stdin.split())
        self.steps = [step for step in stdin.split()]
        self.steps = [step.replace("x", "o").replace("x", "o") for step in self.steps]

    def process(self, step: str, power: int) -> int:
        if step == "+":
            return power + 1
        elif step == "o":
            return power
        else:
            return power * 2

    def max_power(self) -> int:
        max_power = 0
        power = 1
        for step in self.steps:
            power = self.process(step, power)
            max_power = max(max_power, power)
        return max_power

    def output(self, max_power: int) -> str:
        for step in self.steps:
            if step.replace("x", "o")!= "+o" and step.replace("x", "o")!= "ooo":
                self.steps[self.steps.index(step)] = step.replace("x", "o")
        for step in self.steps:
            self.steps[self.steps.index(step)] = "+o" if step == "++" else "ooo"
        return "".join(self.steps)

