    def __init__(self, stdin: str):
        self.stdin = stdin

    def solve(self):
        a, m = map(float, self.stdin.split())
        W, H, X, Y = map(int, self.stdin.split())
        heights = []
        for _ in range(H):
            heights.append(list(map(int, self.stdin.split())))
        heights = [[0 if h == 2001 else h for h in row] for row in heights]

        def distance(x1, y1, x2, y2):
            return abs(x1 - x2) + abs(y1 - y2)

        def tide_interval(v):
            return 12 * (1.5 * a * (1 + 0.5 * a * (1 - 0.5 * a * v ** 2) ** 2) / (1 - 0.5 * a * v ** 2))

        v_max = 1.5 * a * (1 - 0.5 * a * (1 - 0.5 * a) / (1 + 0.5 * a))

        def shortest_distance(x1, y1, v, t):
            x2, y2 = x1 + m * v * (t * (y1 - x1) / (v * t + (1 - 0.5 * a) * x1)), y1 + m * v * (t * (y1 - x1) / (v * t + (1 - 0.5 * a) * x1))
            x2, y2 = max(0, x2), max(0, y2)
            x2, y2 = min(W - 1, x2), min(H - 1, y2)
            return distance(x1, y1, x2, y2)

        max_distance = float('inf')
        for v in range(int(v_max * 100) + 1):
            t = tide_interval(v / 100)
            if 0.999 < t < 1.001:
                min_distance = shortest_distance(X, Y, v / 100, t)
                if min_distance < max_distance:
                    max_distance = min_distance

        return str(max_distance)

